import React from 'react';

import cf_logo from '../assets/images/cf_logo.png';
import medium from '../assets/images/medium.jpg';
import proj from '../assets/images/proj.jpg';



class Carousel extends React.Component{

    constructor(props){
        super(props);
        this.state= {
            items: [
                {
                    id: 0,
                    title: 'Coffee Runners',
                    subTitle: 'CEO, Founder',
                    imgSrc: cf_logo,
                    link: 'https://coffeerunners.ca',
                    selected: false
                },
                {
                    id: 1,
                    title: 'Medium',
                    subTitle: 'Just some thoughts !',
                    imgSrc: medium,
                    link: 'https://medium.com/@arshdeep.grewal989',
                    selected: false
                },
                {
                    id: 2,
                    title: 'Projects',
                    subTitle: 'Some stuff I have made :)',
                    imgSrc: proj,
                    link: 'https://github.com/garrettlove8/evverest',
                    selected: false
                },
            ]

        }

    }

    render(){

        return(
            <p>this shit works</p>
        )
    }

}

export default Carousel;
